private static void removeMetadataAttribute(CloudBlockBlobWrapper blob,
    String key) {
  HashMap<String, String> metadata = blob.getMetadata();
  if (metadata != null) {
    metadata.remove(key);
    blob.setMetadata(metadata);
  }
}
